('â€œHARI MENANAM POHON INDONESIAâ€  Tahukah kamu, kalau pohon adalah makhluk hidup yang punya fungsi penting banget dalam kehidupan kita. Pohon-pohon ini berperan penting dalam meredam kenaikan gas rumah kaca, salah satu penyebab utama pemanasan global atau global warming.  Nah, Indonesia adalah salah satu negara yang beruntung karena memiliki kuantitas pohon yang banyak, seiring luasnya area hutan yang kita miliki. Sayangnya area hutan milik kita makin menipis nih, guys. Maraknya pembalakan liar menyebabkan terjadinya pengurangan kawasan hutan (deforestasi). Kondisi ini diperparah dengan produksi emisi yang makin kenceng. Alhasil atmosfer bumi makin panas deh. :(  Demi mengantisipasi hal ini makin memburuk, Presiden Republik Indonesia mengeluarkan Keppres RI Nomor 24 Tahun 2008 ditetapkan bahwa tanggal 28 November merupakan Hari Menanam Pohon Indonesia (HMPI).  Jadi deh besok, 28 November, adalah Hari Menanam Pohon Indonesia. HMPI ini ditandai dengan gerakan satu orang menanam satu pohon yang selanjutnya dikenal dengan One Man One Tree (OMOT). Nah, kamu bisa lho ikut berpartisipasi dalam kegiatan ini. Mulai tanam satu pohon di pekarangan rumahmu.  Satu aksi kecilmu ini #JADIBISA berdampak besar bagi orang banyak lho. Yuk, menanam pohon!   Share dan tag teman kamu ya biar makin banyak yang menanam pohon!', '0000-00-00', 'F0120'),
